import React from 'react';
import { Table } from 'reactstrap';

function App() {
  return (
    <div className="App container">
      <Table>
        <thead>
          <tr>
            <th>Id</th>
            <th>Name</th>
          </tr>
        </thead>
      </Table>
    </div>
  );
}

export default App;
